import React from "react";
import "../../App.css";
import Breadcrumb from '../breadcrumb/Breadcrumb'
import Environment from "../about/environment/Environment";
import shisha from '../../images/categories/shisha.jpg'
import garden from '../../images/old-photos/garden-photos/garden-with-gate.jpg'
import garden2 from '../../images/old-photos/garden-photos/garden2-table.jpg'
import garden3 from '../../images/old-photos/more-photos/garden3.jpg'
import './shisha.css'

export default function Products() {
  return (
    <div className="shisha">
     <Breadcrumb
        image={garden}
        subtitle={"Come and join us for"}
        title={"Fresh fruit shisha"}
      />
      <Environment
        title1={"Discover our shishas"}
        subtitle1={"Like nowhere else"}
        desc1={
          "lorem"
        }
        image1={shisha}
        // squareImage={"russia"}
        title2={"The Secret Garden"}
        desc2={
          "As demand was increasing, the Borscht family set up it's restaurant in London, on the Southern shore of the gulf of Ajaccio. This workshop was larger and better equipped than the first one in Zoza. It has been able to hire and train new co-workers to the art of knife-making. And it is there that today, still, the Borschts food is handmade with the same passion."
        }
        image2={garden2}

      />
    </div>
  );
}
